import React from 'react'
import "./header.scss"

export default function Header() {

  const navLinks = [
    {"name": "Home"},
    {"name": "About"},
    {"name": "Work"},
    {"name": "Skills"},
    {"name": "Contact"}
  ]

  return (
    <header className="App-header">
      <div className="header-nav">
        {navLinks.map(link => (
          <div className="header-link">{link.name}</div>
        ))}
      </div>
    </header>
  )
}
